import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, ImageBackground } from 'react-native';

import React from 'react';
import HomeScreen from './screens/home.screen';
import AddPlant from './screens/addPlant.screen';
import FindPlant from './screens/find.screen';
import WaterReminder from './screens/waterRemind.screen';

import { createMaterialBottomTabNAvigator } from '@react-navigation/material-bottom-tabs';
import { NavigationContainer } from '@react-navigation/native';
import MaterialCommunityIcons from 'react-native-vector-icons/MaterialCommunityIcons';

const Tab = createMaterialBottomTabNAvigator();

export default function App() {
  return (
    <NavigationContainer>
      <Tab.Navigator>
        <Tab.screen name="Home" component={HomeScreen} />
        <Tab.screen name="addPlant" component={AddPlant} />
        <Tab.screen name="find" component={FindPlant} />
        <Tab.screen name="waterReminder" component={WaterReminder} />
      </Tab.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'beige',
    justifyContent: 'space-between',
  },
  hibernacle: {
    flex: 1,
  },
  botBar: {
    height: 100,
  },
});
